export default {
  name: 'Reply',
  props: {
    headURL: {
      type: String,
      default: 'https://cdn.quasar.dev/img/avatar.png'
    },
    nickName: {
      type: String,
      required: true
    },
    content: {
      type: String,
      default: ''
    }
  },
  methods: {
    Reply () {
      this.$emit('changeReplyPrefix', this.nickName)
    }
  }
}
